import React, { useState } from "react";
import { Link } from "react-router-dom";

const HamburgerNavigation = () => {
  const [isNavOpen, setIsNavOpen] = useState(false);

  return (
    <div
      className="mx-auto px-6 md:px-20 xxl:px-0 flex justify-between items-center py-8 px-10 text-white font-medium bg-yellow-200"
      style={{ backgroundColor: "#C4B682" }}
    >
      <div className="cursor-pointer px-6 md:px-20 mb-4 flex justify-between">
        <Link to="/">
          <div className="mt-2">
            <img src="" alt="" className="w-32 sm:w-40 md:w-48" />
          </div>
        </Link>
        <button className="p-0" onClick={() => setIsNavOpen((prev) => !prev)}>
          <span
            className="hamburger_line_1 block w-10 bg-white mb-2"
            style={{ height: "1.5px" }}
          ></span>
          <span
            className="hamburger_line_3 block w-10 bg-white"
            style={{ height: "1.5px" }}
          ></span>
        </button>
      </div>
    </div>
  );
};

export default HamburgerNavigation;
